import { Grid, Button, Paper, InputBase, IconButton } from "@material-ui/core";
import React from "react";

export default function ManageMovie() {
  return (
    <div>
      <Grid container>
        <Grid item xs={12}>
          <Button variant="contained" color="primary">
            Thêm
          </Button>
        </Grid>
        <Grid item xs={12}>
          <Paper elevation={1} component="form">
            <InputBase placeholder="Tìm kiếm phim" />
            <IconButton>
              <SearchIcon color="primary" />
            </IconButton>
          </Paper>
        </Grid>
      </Grid>
    </div>
  );
}
